import { useEffect, useState } from "react"

export default function CountryList() {
    const [countryList, setCountryList] = useState([]);

    useEffect(() => {
        fetch(`${process.env.REACT_APP_GET_COUNTRY_LIST_BASE_URL}/getAvailableCountries`)
        .then(response => {
            if(!response.ok) {
                throw new Error(response.status)
            }
        })
        .then(data => {
            setCountryList(data)
        })
    }, [])

    useEffect(() => {
        countryList.map()
    }, [countryList])

    return (
        <></>
    )
}
